import React from "react";
// import "./checkout.scss";

const CheckoutPage = () => {
  return (
    <div className="outer" style={{ width: "80%", border: "solid blue" }}>
      <div
        className="wrapper"
        style={{ display: "flex", justifyContent: "center", width: "100%" }}
      >
        <div style={{ width: "20%" }}>Product</div>
        <div style={{ width: "20%" }}>Description</div>
        <div style={{ width: "20%" }}>Quantity</div>
        <div style={{ width: "20%" }}>Price</div>
        <div style={{ width: "20%" }}>Remove</div>
      </div>
    </div>
  );
};

export default CheckoutPage;
